import React from "react";
import '../styles/footer.css';

function Footer() {
    return (
        <div className="footer">
            <h5>Made by Eli Chase</h5>
            <h6>Powered by React.hs</h6>
            <p>April, 2023</p>
        </div>
    )
}

export default Footer
